import React, { useState, useEffect } from "react";
import { motion, AnimatePresence } from "framer-motion";

const FadeIn = ({ children, delay = 0 }) => (
  <motion.div
    initial={{ opacity: 0, y: 12 }}
    animate={{ opacity: 1, y: 0 }}
    transition={{ duration: 0.6, delay }}
  >
    {children}
  </motion.div>
);

export default function YakushkinPortfolio() {
  const images = [
    "/images/photo_2025-08-22_20-29-50.jpg",
    "/images/photo_2025-08-22_20-30-08.jpg",
    "/images/photo_2025-08-22_20-30-08.jpg",
    "/images/photo_2025-08-22_20-30-18.jpg",
    "/images/photo_2025-08-22_20-30-23.jpg",
  ];

  const [index, setIndex] = useState(0);

  useEffect(() => {
    const interval = setInterval(
      () => setIndex((prev) => (prev + 1) % images.length),
      5000 // каждые 5 секунд
    );
    return () => clearInterval(interval);
  }, [images.length]);

  return (
    <div
      style={{
        minHeight: "100vh",
        color: "#1e293b",
        display: "flex",
        flexDirection: "column",
      }}
    >
      {/* Hero with slider */}
      <section
        style={{
          position: "relative",
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          flexGrow: 1,
          padding: "4rem 2rem",
          overflow: "hidden",
          textAlign: "center",
        }}
      >
        {/* Background slider */}
        <AnimatePresence>
          <motion.div
            key={index}
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            exit={{ opacity: 0 }}
            transition={{ duration: 1 }}
            style={{
              position: "absolute",
              top: 0,
              left: 0,
              right: 0,
              bottom: 0,
              backgroundImage: `linear-gradient(rgba(0,0,0,0.5), rgba(0,0,0,0.5)), url(${images[index]})`,
              backgroundSize: "cover",
              backgroundPosition: "center",
            }}
          />
        </AnimatePresence>

        {/* Text on top */}
        <div style={{ position: "relative", color: "#fff", zIndex: 1 }}>
          <FadeIn>
            <h1 style={{ fontSize: "3rem", marginBottom: "1rem" }}>
              Якушкин Д.О.
            </h1>
          </FadeIn>
          <FadeIn delay={0.1}>
            <p style={{ fontSize: "1.25rem", maxWidth: "600px", margin: "0 auto" }}>
              Индивидуальный предприниматель в строительстве. Команда опытных
              мастеров, ориентированных на результат.
            </p>
          </FadeIn>
        </div>
      </section>

      {/* About */}
      <section
        style={{
          maxWidth: "800px",
          margin: "0 auto",
          padding: "4rem 2rem",
        }}
      >
        <FadeIn>
          <h2 style={{ fontSize: "2rem", marginBottom: "1rem" }}>О нас</h2>
          <p>
            Мы — слаженная бригада специалистов, выполняющая строительные и
            ремонтные работы любой сложности. На нашем счету множество
            реализованных объектов — от загородных домов до коммерческих
            помещений. Работаем ответственно и слаженно, ценим доверие и
            профессионализм.
          </p>
        </FadeIn>
      </section>

      {/* Contact */}
      <section
        style={{
          maxWidth: "600px",
          margin: "0 auto",
          padding: "4rem 2rem",
        }}
      >
        <FadeIn>
          <h2 style={{ fontSize: "2rem", marginBottom: "1rem" }}>Связаться</h2>
          <p style={{ marginBottom: "1rem" }}>
            Позвоните или напишите нам, чтобы обсудить ваш проект.
          </p>
          <p>📞 +7 953 447-12-18</p>
          <p>📧 dimayakyshkin6@mail.ru</p>
        </FadeIn>
      </section>

      {/* Footer */}
      <footer
        style={{
          textAlign: "center",
          padding: "2rem",
          fontSize: "0.875rem",
          color: "#64748b",
          backgroundColor: "#f8fafc",
        }}
      >
        © {new Date().getFullYear()} Якушкин Д.О. Все права защищены.
      </footer>
    </div>
  );
}
